import React from 'react';

const NameList=()=>{
    const persons=[
        {
            id:1,
            name:'shivam'
        },
        {
            id:2,
            name:'rakesh'
        },
        {
            id:3,
            name:'satyam'
        }
    ]
const personlist= persons.map(person => <h2>I am {person.name} with id {person.id}</h2>)
    return(
      personlist
    )
}
export default NameList
